import React from "react";
import Card from "./Card/Card.js";
import { StyledSkills } from "./Skills.styled";

const Skills = () => {
  return (
    <StyledSkills>
      <h1 className="heading">SKILLS.</h1>
      <h2 className="subheading">BECAUSE TECHNOLOGY MATTERS.</h2>
      <div className="mainContainer1">
        <Card skill={"C++"} progress={90} classes={"one thumb thumb_2"}/>
        <Card skill={"C"} progress={80} classes={"two thumb thumb_2"}/>
        <Card skill={"REACT-JS"} progress={70} classes={"three thumb thumb_2"}/>
        <Card skill={"NODE-JS"} progress={60} classes={"four thumb thumb_2"}/>
      </div>
      <div className="mainContainer2">
        <Card skill={"BOOTSTRAP"} progress={50} classes={"five thumb thumb_2"}/>
        <Card skill={"HTML"} progress={40} classes={"six thumb thumb_2"}/>
        <Card skill={"CSS"} progress={30} classes={"one thumb thumb_2"}/>
        <Card skill={"PYTHON"} progress={20} classes={"one thumb thumb_2"}/>
      </div>
    </StyledSkills>
  );
};
export default Skills;
